  \"Tamarac National Wildlife Refuge: Annual narrative report: Calendar year 1988\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:40.733246\",\n\t\"name\": \"tamarac-national-wildlife-refuge-annual-narrative-report-calendar-year-1988\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Tamarac
  National Wildlife Refuge outlines Refuge accomplishments during the 1988 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  management planning, compliance with environmental and cultural resource mandates,
  and research and investigations. Refuge administration is outlined; information
  about personnel, youth programs, other manpower programs, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, forests, croplands, grasslands, fire management, pest control,
  and water rights. The wildlife section of the report discusses wildlife diversity,
  endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
  raptors, other migratory birds, game mammals, other resident wildlife, fisheries
  resources, wildlife propagation and stocking, animal control, and marking and bird
  banding. The public uses of the Refuge described in this report include outdoor
  classrooms, interpretive programs, off-road vehicling, law enforcement, and cooperating
  associations. The equipment and facilities section of the report provides information
  about new construction, rehabilitation, equipment utilization and replacement, communications
  systems, computer systems, and energy conservation. Photographs and Refuge brochures
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
